                      answer: {
                        entry:
                          "With the new Outreach and Retention Workers in place, the team collaborated to devise a plan to reach uninsured children and to help retain those already enrolled.  The plan was to begin outreach efforts by contacting/visiting schools to advise/remind them about the ALL Kids program, and to have them add ALL Kids contact information and a link to our website to their website, social media posts, etc.  Outreach and Retention Workers began developing materials targeted to schools and researching points of contact within the schools.  \nWhile there is not currently a formal measure for effectiveness in place, ALL Kids has been added to one of the state’s largest school district webpages under school health resources. This indicates success from efforts made during the COVID emergency, which has been a difficult time for outreach.  \nPrior to the COVID emergency, ALL Kids also participated in professional association conferences within the state to provide education to our partners and communities regarding ALL Kids.  Throughout the year, ALL Kids also sent applications and brochures to schools, agencies, community partners and families in Alabama.\n\n\n",
                      },
