                                entry:
                                  "The HSI began during FY2020 and experienced limitations on outreach/education due to the COVID-19 pandemic, cultural sensitivity issues of potential enrollees,  and the language barriers of potential enrollees and their support systems.   While all of these issues presented roadblocks for continuing to work to implement the program, there were successes experienced in the first full year of program implementation. Some of those successes include securing sustainable support systems and healthcare mentors for very young, disadvantaged enrollees such as a 13-year-old pregnant girl who presented with no plans for attending school and furthering her education.  She had no reliable adult support systems, and very little knowledge of how to access healthcare systems in her own community; her 28-year-old mother had no knowledge of how to best help her daughter.  Through the work of the HSI care coordinators, there is now in place a formalized home school curriculum, community support program, and personnel to mentor her within the healthcare system during her pregnancy and identified support programs and personnel to link her and her baby to needed resource post-delivery.",
