                  id: "2020-03-c-05",
                  text: "Tracking a cohort of children enrolled in CHIP (Title XXI) will indicate how long a specific group of children stays enrolled over an 18-month period. This information is required by Section 402(a) of CHIPRA. \nTo track your cohort, identify a group of children ages 0 to 16 years who are newly enrolled in CHIP and/or Medicaid as of January through March 2020 (the second quarter of FFY 2020). Children in this cohort must be 16 years and 0 months or younger when they enroll to ensure they don't age out of the program by the end of the 18-month tracking period. \nYou’ll identify a new cohort every two years. This year you’ll report on the number of children at the start of the cohort (Jan - Mar 2020) and six months later (July - Sept 2020). Next year you’ll report numbers for the same cohort at 12 months (Jan - Mar 2021) and 18 months later (July - Sept 2021). If data is unknown or unavailable, leave it blank — don’t enter a zero unless the data is known to be zero.",
