                      answer: {
                        entry:
                          "Child and Adolescent Well Care Health Measures\n\n•\tHEDIS® MY 2019 Childhood Immunization Status improved for HUSKY A and B by:\no\t2.23% for DTaP\no\t1.20% for Hepatitis B\no\t3.64% for Pneumococcal Conjugate\no\t3.01% for Rotavirus\no\t4.17% for Combination #2\no\t5.92% for Combination #3\no\t6.29% for Combination #4\no\t8.65% for Combination #5\no\t1.94% for Combination #6\no\t8.70% for Combination #7\no\t2.36% for Combination #8\no\t4.66% for Combination #9\no\t4.66% for Combination #10 \n•\tHEDIS® MY 2019 Immunizations for Adolescents for HUSKY A and B improved by:\no\t1.35% Meningococcal\no\t1.06% Tdap\no\t25.52% HPV\no\t2.49% Combination #1\no\t26.93% Combination #2\n•\tDevelopmental Screening in the First Three Years of Life (Ages 1-3) improved by 2.84%\n•\tBehavioral Health Screening (Ages 1-18) improved by 12.54%\n•\tHEDIS® MY 2019 Well Child Visits in the Third, Fourth, Fifth and Sixth Year of Life improved by 3.11% for HUSKY A and B\n•\tHEDIS® MY 2019 Adolescent Well Care Visits improved by 4.00% for HUSKY A and B\n\nOther Measures\n\n•\tHEDIS® MY 2019 Ambulatory Care- ED Visits (Per 1000 MM) improved by:\no\t4.19% for HUSKY A and B\n•\tHEDIS® MY 2019 Chlamydia Screening in Women 16-20 years improved by:\no\t2.86% for HUSKY A and B\n•\tHEDIS® MY 2019 Non-Recommended Cervical Cancer Screening in Adolescent Females improved by:\no\t25.00% for HUSKY A and B\n•\tHEDIS® MY 2019 Medication Management for People With Asthma – Medication Compliance 75% improved by 1.50% for HUSKY A and B\n•\tAsthma Patients with One or More Asthma-Related Emergency Department Visit (Ages 2-20) improved by 8.00%\n\n",
                      },
